description:
Dropping the Knife: Kurdistan

Sociopolitical Documentary hosted by Shaimaa Khalil, published by BBC broadcasted as part of BBC Our World series in 2013 - English narration


Information
------------------------------

In 2011 Female Genital Mutilation was banned in Kurdistan as part of a wide-ranging law to improve women's rights. Since then the rate of FGM has almost halved in some areas. Shaimaa Khalil reports on the remarkable grass roots campaign that led to this centuries old practice being outlawed. Using rarely seen footage, she hears from girls and women who describe the devastating impact FGM has on their relationships.

